@tablethotels dives into Spain’s unique blend of vineyard hotels.

Tablet is the official hotel selection of the Michelin Guide, and today they’re looking at the #3 wine producer in the world (Spain, right behind Italy and France, miles ahead of everyone else). While that made it a top contender for their spotlight, it was the bold mix of design styles at the country’s vineyard hotels that truly sealed the deal.

Tablet is your source for discovering the world’s most exciting places to stay. 

